  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113761 includes chemical,
  discrete sample, physical and profile data collected from AURORA AUSTRALIS in the
  Indian Ocean and South Pacific Ocean from 1996-08-22 to 1996-09-21 and retrieved
  during cruise CARINA/09AR19960822. These data include ALKALINITY, DELTA CARBON-13,
  DELTA CARBON-14, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE,
  NITRATE, NITRITE, PHOSPHATE, Potential temperature (theta), SALINITY, SILICATE and
  WATER TEMPERATURE. The instruments used to collect these data include CTD and bottle.
  These data were collected by Bronte Tilbrook and S. Rintoul of Commonwealth Scientific
  and Industrial Research Organization as part of the CARINA/09AR19960822 data set.nnThe
  CARINA (CARbon dioxide IN the Atlantic Ocean) data synthesis project is an international
  collaborative effort of the EU IP CARBOOCEAN, and U.S. partners. It has produced
  a merged internally consistent data set of open ocean subsurface measurements for
  biogeochemical investigations, in particular, studies involving the carbon system.
  The original focus area was the North Atlantic Ocean, but over time the geographic
  extent expanded and CARINA now includes data from the entire Atlantic, the Arctic
  Ocean, and the Southern Ocean.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
